    const bool USE_BACKUP = false;
    static int Solve(int p, int w, int max = 1000, int min = 1)
    {
        if (0 < p * w - 100) return -2;
        string path = @$"C:\Users\{Environment.UserName}\Desktop\b\{p}-{w}.txt";
        if (USE_BACKUP && File.Exists(path))
        {
            var file = File.ReadAllText(path).Split(',').Where(x => x.Length != 0).ToArray();
            return file.Select(int.Parse).DefaultIfEmpty(-1).Max();
        }

        var winProb = p;
        var loseProb = 100 - winProb;
        int res = 2 <= w && 50 < winProb ? 1 : -1;
        List<int> resList = new List<int>();
        if (winProb == 0) return res;
        for (int n = min; n <= max; n++)
        {
            BigInteger possibleConb = 0;
            var winCnt = BigInteger.Pow(winProb, n);
            var loseCnt = BigInteger.Pow(loseProb, 0);
            var cnt = BigInteger.One;
            for (int win = n; win >= 0; win--)
            {
                if (win * w - n <= 0) break;
                //var cnt = Factorial(n) / Factorial(win) / Factorial(n - win);
                possibleConb += cnt * winCnt * loseCnt;
                winCnt /= winProb;
                loseCnt *= loseProb;
                cnt *= win;
                cnt /= n - win + 1;
            }
            BigInteger totalConb = BigInteger.Pow(100, n);
            if (possibleConb <= totalConb / 2) continue;
            resList.Add(n);
            res = n;
        }
        File.WriteAllText(path, string.Join(",", resList));
        return res;
    }


    static List<BigInteger> factorialMemo = new List<BigInteger>() { 1 };
    static BigInteger Factorial(int x)
    {
        for (int i = factorialMemo.Count; i <= x; i++) factorialMemo.Add(factorialMemo.Last() * i);
        return factorialMemo[x];
    }
